import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import NavBar from './Components/NavBar.js';
import HeaderContent from './Components/HeaderContent.js';
import MainContent from './Components/MainContent.js';
import Meetups from './Components/Meetups.js';
import Members from './Components/Members.js';
import MainTitle from './Components/MainTitle.js';
import MainTitleSee from './Components/MainTitleSee.js';
import PastMeetups from './Components/PastMeetups.js';
import Footer from './Components/Footer.js';


class App extends Component {

  constructor(props){
    super(props)
    this.state = {
      title: 'QTemu',
      menu1: 'Create Meetup',
      menu2: 'Explore',
      headercontent: [
        {        
          location: 'Jakarta Indonesia',    
          members: '1,078',
          organizers: 'Ardhy Wiranata'      
        },
      ],
      headercontent: [
        {        
          title: 'Jakarta Indonesia',    
          members: '1,078',
          organizers: 'Ardhy Wiranata'      
        },
      ],
      posts: [
        {        
          title: 'Obi Wan',    
          image: '/src/aaa.img',
          excerpt: 'halo bla bla bla'      
        },
        {        
          title: 'Obi Wan1',    
          image: '/src/aaa.img',
          excerpt: 'halo bla bla bla'      
        }
        ,
        {        
          title: 'Obi Wan2',    
          image: '/src/aaa.img',
          excerpt: 'halo bla bla bla'      
        }
      ],         
    }
  }

  render() {
    let { title, menu1, menu2, posts, headercontent } = this.state;
    return (
      <React.Fragment>


        <NavBar title={title} menu1n={menu1} menu2n={menu2}/>
        <HeaderContent headercontent={headercontent}  />
        <MainTitle/>
        <MainContent/>
        <MainTitle/>
        <Meetups/>
        <MainTitleSee/>
        <Members/>
        <MainTitleSee/>
        <PastMeetups posts={posts}/>   
        <Footer/>     
      </React.Fragment>
    );
  }
}

export default App;
